func (lprs *LLMProviderResolutionSelect) sqlScan(ctx context.Context, root *LLMProviderResolutionQuery, v any) error {
	selector := root.sqlQuery(ctx)
	aggregation := make([]string, 0, len(lprs.fns))
	for _, fn := range lprs.fns {
		aggregation = append(aggregation, fn(selector))
	}
	switch n := len(*lprs.selector.flds); {
	case n == 0 && len(aggregation) > 0:
		selector.Select(aggregation...)
	case n != 0 && len(aggregation) > 0:
		selector.AppendSelect(aggregation...)
	}
	rows := &sql.Rows{}
	query, args := selector.Query()
	if err := lprs.driver.Query(ctx, query, args, rows); err != nil {
		return err
	}
	defer rows.Close()
	return sql.ScanSlice(rows, v)
}
